import React from 'react';

function MoreButton(props) {
  return (
    <a href={props.link}>
    <button id="more-button">{props.text}</button>
    </a>
  );
}

MoreButton.defaultProps = {
  text: 'More',
  link: 'https://cat-bounce.com/'
};

export default MoreButton;
